import React from "react";
import Data from "./data";

const List = () => {
    const people = Data;
    return (
        <>
            {people.map((person) => {
                const { id, name, age } = person;
                return (
                    <div key={id}>
                        <h4>{name}</h4>
                        <p>{age} years</p>
                    </div>
                );
            })}
        </>
    );
};

export default List;
